import { Component, EventEmitter, Input, Output } from '@angular/core';

@Component({
  selector: 'app-button',
  templateUrl: './button.component.html',
  styleUrls: ['./button.component.css'],
})
export class ButtonComponent {
  @Input()
  id!: string;
  @Input() variant: 'Standard' | 'Filled' | 'Outlined' = 'Standard';
  @Input() background:string='#3056d3';
  @Input() autofocus: boolean = false;
  @Input() classes: string = '';
  @Input() color: string = '#3056d3';
  @Output() onClick = new EventEmitter<Event>();

  handleClick(event: Event) {
    this.onClick.emit(event);
  }
}
<button
  class="button-primary"
  [id]="id ? id : 'btn'"
  [ngClass]="classes"
  [style.background-color]="variant === 'Filled' ? background : 'transparent'"
  [style.border]="variant === 'Outlined' ? '1px solid #3056d3' : 'none'"
  [style.color]="color ? color : 'black'"
  type="button"
  (click)="handleClick($event)"
>
  <ng-content></ng-content>
</button>
